window.bookSummaryJSON = "<p>When Kevin Murdock, martial artist and outdoorsman extraordinaire, is revived from suspended animation aboard a transport pod, he and his nine fellow occupants have no idea what to expect.</p> <p>Murdock argues for caution after seeing something strange: animals also inhabit their new environment, all of them larger than their Earthly counterparts.&nbsp;Conflict soon erupts between Murdock and James Whittier - a politician with a lust for power and control.</p> <p>But soon, they all realize that there's something even more dangerous onboard. Something that might cost them all their lives.</p>"; 
